export enum MenuTypeEnum{
    None = -1,
    Pasta = 0,
    Meat = 1,
    Soup = 2,
    Pastries = 3
}

export enum UnitTypeEnum{
    Kilo = 0,
    Gramm = 1,
    Liter = 2,
    Stk = 4
}
